import './todo.js';

function App() {
  const todoList = ["Hit the gym", "Pay bills","Take a Photos"]
  return (
    <div class="container">
      <div id="myDIV" class="header">
        <h2 style={{margin:"5px"}}>My To Do List</h2>
        <input type="text" id="myInput" placeholder="Title..."/>
          <span onclick="addTodo()" class="addBtn">Add</span>
      </div>

      <ul id="myUL">
        {
          todoList.map(e => 
            <li>{e}</li>
          )
        }
      </ul>

    </div>
  );
}

export default App;
